import React from 'react';
import './custom-button.styles.scss';

const CustomButton = ({children , isGoogleSignIn ,inverted , remove, ...otherProps}) => (
    <button className={`${remove ? 'remove': ''} ${inverted ? 'inverted': ''} ${isGoogleSignIn ? 'google-sign-in': ''} custom-button`} {...otherProps}>
        {children}
    </button>
)

export default CustomButton;
